      var e = this;
      return HTML.Raw(
        '<div class="home-container">\n    <div class="home home-1">\n      <div class="home-bg"></div>\n      <div class="home-content">\n        <h2>Op zoek naar een spannende avond met een groep vrienden?</h2>\n        <p>Kruip samen met je vrienden in de rollen van mensen uit Doel. Ieder heeft zo zijn geheimen en relaties. Aan jou om er achter te komen wie de moord gepleegd heeft.</p>\n        <p>Met moorddiner "Doel" ontvang je thuis je gasten, die allemaal verkleed zijn naar hun rol.</p>\n        <a class="readmore" href="/moorddiners">Wat is een moorddiner?</a>\n      </div>\n    </div>\n    <div class="home home-2">\n      <div class="home-bg"></div>\n      <div class="home-content">\n        <h3>Het spookdorp Doel...</h3>\n        <p><i>Lege straten met ingegooide ramen Kapotte deuren die klapperen in de windSlechts zonderlinge figuren dwalen door het dorp\n        <br>\n        <br>\n        Het lijk van een achtergebleven dorpeling in een leegstaand pand. Was het een ongeluk? Of moord?</i>\n        </p>\n        <a class="readmore" href="/moorddiners/doel">Meer over moorddiner Doel</a>\n      </div>\n    </div>\n    <div class="home home-3">\n      <div class="home-bg"></div>\n      <div class="home-content">\n        <ul>\n          <li>NU: Van &euro; 9.50 voor &euro; 7.50 p.p.</li>\n          <li>8 - 12 personen </li>\n          <li>&nbsp;</li>\n          <li>Thuis</li>\n          <li>2 weken lang voorpret</li>\n          <li>Zelf het diner verzorgen</li>\n        </ul>\n        <a class="readmore" href="bestellen">Bestellen</a>\n      </div>\n    </div>\n  </div>'
      );
